import React from 'react';
import Button from './Button'
import {Link} from 'react-router-dom'
import axios from 'axios'
class EmployeesList extends React.Component {
  render() {
    let employeeId = this.props.match.params.id;
    if(this.props.items.length > 0){
      return (
        <ul>
          {this.props.items.map(item => (
            <li key={item.empNo}>ID: {item.empNo} - First Name: {item.firstName} - Last Name: {item.lastName} 
           <Link to ={`/edit/${employeeId}`} ><Button text="Edit" /></Link> 
            <Button onClick={this.onDelete.bind(this)} text="Delete" />
            </li>
          ))}
        </ul>
      );
    }
    else{
      return (
        <h4>No Result</h4>
      );
    }

  }
  onDelete(){
   return 1
  }



}

export default EmployeesList
